(23, 'WA', 'Kemampuan Verbal', 3, 'Semua burung dapat terbang. Penguin adalah burung. Maka:', 'Penguin dapat terbang', 'Penguin tidak dapat terbang', 'Penguin bukan burung', 'Penguin adalah mamalia', 'Tidak dapat disimpulkan', '2025-08-27 04:07:10'),
